import React from "react";
import ButtonToSet from "./ButtonToSet";

const ButtonToSetList = () => {
  const buttonName = ["New Game", "Reset"];
  const buttonList = buttonName.map((cur, index) => (
    <ButtonToSet btnName={cur} key={index} />
  ));

  return <div>{buttonList}</div>;
};

export default ButtonToSetList;
